import React, { useEffect } from 'react';
import fetch_token from './token_info.js'; // 导入 fetch_token 函数

function App() {
    const username = "1wadadwa5219";

    useEffect(() => {
        // 调用 fetch_token 函数并传递 username 和 team 参数
        fetch_token(username, "울산");
    }, [username]); // 当 username 变化时重新调用

    // 获取存储在 localStorage 中的 token 和消息
    const localUser=localStorage.getItem('username')
    const token = localStorage.getItem('access_token');
    const message = localStorage.getItem('msg');

    return (
        <div>
            <h3>Information</h3>
            <p>Token: {token || "No token available"}</p>
            <p>Message: {message || "No message available"}</p>
            <p>localUser: {localUser || "No message available"}</p>
        </div>
    );
}

export default App;




